-- Imperial County EMS Agency protocols
INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'IMP-100', 'Cardiac Arrest', 'Cardiac', 'Imperial County EMS cardiac arrest protocol. High-quality CPR. Defibrillation for shockable rhythms. Epinephrine 1mg IV/IO q3-5min. Amiodarone for refractory VF/pVT.', 'https://www.icphd.org/environmental-health/emergency-medical-services/', NOW()
FROM counties c WHERE c.name = 'Imperial County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'IMP-200', 'STEMI', 'Cardiac', 'Imperial County STEMI protocol. 12-lead ECG. Aspirin 324mg. Nitroglycerin. Cath lab activation. Transport to PCI center.', 'https://www.icphd.org/environmental-health/emergency-medical-services/', NOW()
FROM counties c WHERE c.name = 'Imperial County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'IMP-300', 'Stroke', 'Neurological', 'Imperial County stroke protocol. FAST assessment. Last known well time. Blood glucose. Transport to stroke center.', 'https://www.icphd.org/environmental-health/emergency-medical-services/', NOW()
FROM counties c WHERE c.name = 'Imperial County EMS Agency' AND c.state = 'California';

INSERT INTO protocolChunks (countyId, protocolNumber, protocolTitle, section, content, sourcePdfUrl, createdAt)
SELECT c.id, 'IMP-400', 'Heat Emergency', 'Environmental', 'Imperial County heat emergency protocol. Remove from heat. Cool patient. IV fluids. Monitor for heat stroke signs.', 'https://www.icphd.org/environmental-health/emergency-medical-services/', NOW()
FROM counties c WHERE c.name = 'Imperial County EMS Agency' AND c.state = 'California';

